Defendant Terrence Martez Campbell in court with attorney Steven R. Wiechmann.  Defendant Terrence Martez Campbell in custody.  Daniel J. Gabler appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

AS TO BOTH COUNTS:  Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  Sentencing proceeded.  Statements by the State, defense and defendant.  

AS TO COUNT 1:  Court sentenced defendant to serve 47 days  in the House of Correction with credit for 47 days served FOR A TIME SERVED DISPOSITION.  

Court ordered defendant to pay ALL COSTS and SURCHARGES during the term of probation in Count 2 or, as a penalty if not paid, convert to a civil judgment.

AS TO COUNT 2:  Defendant sentenced to serve 6 MONTHS in the House of Correction.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions:  
*  AODA assessment/treatment deemed appropriate;
*  Mental health assessment/treatment deemed appropriate;
*  Take all prescribed medications;
*  Referred to the Mental Health Unit of DOC;
*  Commit no new crimes;
*  Maintain part time employment;
*  No contact with Pick and Save - 1100 E Garfield Avenue;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment;
*  Pay all costs and surcharges as to Count 1 or, if not paid, convert to a civil judgment.

Court ordered restitution set at $0.00.  Notice of Right to Seek Postconviction Relief received and filed.
